import {  Link } from "react-router-dom";

const Layout = () => {
  return (
    <>
      <div>
        <Link to="/">Home</Link>
        <Link to="/gallery">Gallery</Link>
        <Link to="/event">Home</Link>
        <Link to="/contact">Home</Link>
        <Link to="/feedback">Home</Link>
      </div>
    </>
  )
};

export default Layout;
